import axios from "axios";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { Card, Button } from "react-bootstrap";

const ShowPosts = () => {
  const [Posts, setPosts] = useState([]);

  const fetchPosts = async () => {
    const result = await axios.get("http://localhost:8000/api/");

    console.log(result.data);
    setPosts(result.data);
  };

  useEffect(() => {
    fetchPosts();
  }, []);

  const goToDetail = () => {
    alert("detail page");
  };

  return (
    <div className="background">
      <h1>Hey</h1>
      <div className="main-students-show">
      {Posts
          .filter((post) => post.category === "Cook")
          .map((filteredPost, index) => (
            <div>
              <div className="table-row">
                <Link to="" className="subjects">
                  <div>{filteredPost.title}</div>
                  <p>{filteredPost.description}</p>
                  <span>
                    Started by
                    <b>
                      <a href=""> {filteredPost.owner}</a>
                    </b>
                  </span>
                </Link>
                <div className="replies">
                  3 replies <br></br> 125 views
                </div>
                <div className="last-reply">
                  Nov 24 2021 <br></br> by
                </div>
              </div>
            </div>
          ))}
      </div>
    </div>
  );
};
export default ShowPosts;
